import './card.css'

export default function Card({item}){
    return(
        <div key ={item.idUser} id="card">
            <img id="card-img"></img>
            <label>{item.title}</label>
            <div>
                <p>{item.author}</p>
                <p>{item.isbn}</p>
            </div>
        </div>
    )
}
